        <div>
            <NavHeader />
            {cart.map(cart => (
                <Cart id={cart.id}
                        nama={cart.nama} 
                        harga={cart.harga}
                        qty={cart.qty}/>
            ))}
        </div>
    )
}

export default ListCart
